import React from "react";
import Typography from "@material-ui/core/Typography"
const Contact = () => {
  return (
    <div>
      <h2>모두를 위한 은퇴계산기 만든사람 소개</h2>
      <h3>이름 : 정승진</h3>
      <h3>학교 및 전공 : 한국방송통신대학교(인천), 컴퓨터과학과</h3>
      <h3>학번 : 201734-243047</h3>
      <br />
      <h2>문의사항</h2>
      <br />
      <h3>프로그램에 대한 문의사항은 아래의 연락처로 문의 부탁드립니다.</h3>
      <br />
      <h4>Email : 13ruce.j@gmail.com</h4>
      <h4>전화번호 : 010-XXXX-XXXX</h4>
    </div>
  )
};

export default Contact;
